function fn_cancel() {
	// dataset initailize
	ds_master.Reset();
	ds_master1.DeleteAll();	

	ds_list.Reset();
	ds_list1.DeleteAll();
	ds_list2.DeleteAll();

	// gfn_initDs(ds_cond, true);

	for(var i=0; i<101; i++){
		object("div_pop.ed_FLR"+i).text = "";
		object("div_pop.ed_FMM"+i).text = "";		
	}

 	// init data set
	ds_cond.SetColumn(0, "REP", "H");
	ds_list_OnLoadCompleted('','','',0);
}
function fn_clear() {
	// dataset initailize
	ds_master.DeleteAll();
	ds_master1.DeleteAll();	

	ds_list.DeleteAll();
	ds_list1.DeleteAll();
	ds_list2.DeleteAll();

	gfn_initDs(ds_cond, true);
	gfn_initDs(ds_master, true);
	gfn_initDs(ds_list, true);

	// field initailize
	div_pop.ed_pjt.Text = "";
	div_pop.ed_hno.Text = "";
 	div_pop.ed_hnos.Text = "";

 	// init data set
	ds_master.SetColumn(0, "CESDBBJD", today());
	ds_cond.SetColumn(0, "REP", "H");

	// etc
	for(var i=0; i<35; i++){
		object("div_pop.ed_FLR"+i).text = "";
		object("div_pop.ed_FMM"+i).text = "";		
	}
}
