/********************************************************************************
* 기      능   : 저장 Callback  
********************************************************************************/
function fn_afterSave(errCode, errMsg) {
	if ( ds_error.rowcount() > 0 ) {
		gfn_showAlert("CE00001");
	} else {
		gfn_showAlert("CI00003");		
		SELFLG = "Y";
	}
}
/********************************************************************************
* 기      능   : 삭제 Callback  
********************************************************************************/
function fn_afterDelete(errCode, errMsg) {
	if ( ds_error.rowcount() > 0 ) {
		gfn_showMsg("CE00001");
	} else {
		gfn_showMsg("CI00003");	

		for(var i=0; i<101; i++){
			object("div_pop.ed_FLR"+i).text = "";
			object("div_pop.ed_FMM"+i).text = "";		
		}
		SELFLG = "Y";
		fn_query();
	}	
}
/********************************************************************************
* 기      능   : 출력전 저장 Callback  
********************************************************************************/
function fn_afterPrint(errCode, errMsg) {
	if ( ds_error.rowcount() > 0 ) {
		gfn_showMsg("CE00001");
	} else {
		fn_print2();
		SELFLG = "Y";
	}	
}
