/********************************************************************************
* 기      능   : master / detail 데이터셋 초기 데이터 셋팅 
********************************************************************************/
function ufn_setGrid(){
	grd_list.Redraw = false;
	ds_list.fireEvent = false;
	var rows;
	while(102 > ds_list.GetRowCount()){
		rows = ds_list.InsertRow( ds_list.GetRowCount() );

	}
	ds_list.row = 0;
	ds_list.fireEvent = true;	
	grd_list.Redraw = true;
}

function ufn_makeListDs(){
	var objFLR;
	var crow;

	ds_list.DeleteAll();

	for(var i=0; i<101; i++){
		objFLR = object("div_pop.ed_FLR"+i);
		if(length(objFLR.text)>0){
			crow = ds_list.AddRow();
			ds_list.SetColumn(crow, "CESDCFLR", objFLR.text);
			ds_list.SetColumn(crow, "CESDCFMM", object("div_pop.ed_FMM"+i).text);			
		}		
	}

}
function ufn_verifyField(gbn){
	// 해더 부분
	if(gfn_isNull(div_pop.ed_pjt, true, div_pop.Static0.Text)) return false; // 프로젝트번호
	if(gfn_isNull(div_pop.Edit9, true, div_pop.Static5.Text)) return false;	// 실측자
	if(gfn_isNull(div_pop.Calendar2, true, div_pop.Static3.Text)) return false; // 현장요구일자

	// 리스트 부분
	var curFlr;
	var seaRow;

	ds_list1.DeleteAll();
	ds_list2.DeleteAll();
	ds_list.Filter("CESDCFLR>''");
	ds_list1.copyf(ds_list);
	ds_list.UnFilter();

	if(ds_list1.GetRowCount()==0){
		//Trace("한개이상 입력해 주십시오.");
		gfn_showMsg("CW00136");
		return false;
	}
	for(var i=0; i<ds_list1.GetRowCount(); i++){		
		if(length(ds_list1.GetColumn(i, "CESDCFLR"))>0){
			curFlr = ds_list1.GetColumn(i, "CESDCFLR");
			seaRow = ds_list1.SearchRow("CESDCFLR='"+curFlr+"'", 0, i-1);

			if(seaRow!=-1){
				//Trace("동일한 층이 있습니다.");
				gfn_showMsg("CW00134");
				return false;
			}
		}
	}	

	return true;	
}
function ufn_setSaveDs(){
	var mrow = 0;

	ds_master1.DeleteAll();

	if(length(div_pop.ed_hnos.Text)>0 && indexOf(div_pop.ed_hnos.text, ",")!=-1){
		var hnos = Split(div_pop.ed_hnos.text, ",");

		for(var i=0; i<length(hnos); i++){
			if(length(hnos[i])==3){
				mrow = ds_master1.AddRow();
				ds_master1.CopyRow(mrow, ds_master, 0);			
				ds_master1.SetColumn(mrow, "CESDBHNO", hnos[i]);
				ds_master1.SetColumn(mrow, "CESDBPJT", div_pop.ed_pjt.Text);

				ufn_setListDs(div_pop.ed_pjt.Text, hnos[i]);
			}					
		}		

	} else { 
		if(gfn_isNull(div_pop.ed_hno, true, div_pop.Static2.Text)) return false;

		mrow = ds_master1.AddRow();
		ds_master1.CopyRow(mrow, ds_master, 0);	
		ds_master1.SetColumn(mrow, "CESDBPJT", div_pop.ed_pjt.Text);
		ds_master1.SetColumn(mrow, "CESDBHNO", div_pop.ed_hno.Text);

		ufn_setListDs(div_pop.ed_pjt.Text, div_pop.ed_hno.Text);
	}

	return true;
}
function ufn_setListDs(pjt, hno){
	var crow=0;
	var cseq;
	for(var j=0; j<ds_list1.GetRowCount(); j++){
		crow = ds_list2.AddRow();
		ds_list2.CopyRow(crow, ds_list1, j);
		ds_list2.SetColumn(crow, "CESDCPJT", pjt);
		ds_list2.SetColumn(crow, "CESDCHNO", hno);
		cseq = Lpad(j+1, "0", 3);
		ds_list2.SetColumn(crow, "CESDCSEQ", cseq);		
	}
}


