function fn_print2() 
{
	ds_master_p.DeleteAll();
	ds_list_p.DeleteAll();
	ds_master_p.AddRow();
	ds_list_p.AddRow();

	// 저장할 데이터셋을 복사
	ds_master_p.CopyRow(0,"ds_master",0);
	ds_master_p.SetColumn(0,"CESDBHDM",gfn_formatDate(ds_master_p.GetColumn(0,"CESDBHDM"),'.'));
	ds_master_p.SetColumn(0,"CESDBBJD",gfn_formatDate(ds_master_p.GetColumn(0,"CESDBBJD"),'.'));
	ds_master_p.SetColumn(0,"CESDBNAP",gfn_formatDate(ds_master_p.GetColumn(0,"CESDBNAP"),'.'));
	ds_master_p.SetColumn(0,"CESDBNA2",gfn_formatDate(ds_master_p.GetColumn(0,"CESDBNA2"),'.'));

	if (ds_master_p.rowcount < 1)
	{
		gfn_showAlert("CW00013");
		return;
	}

	for(var i=0; i<101; i++)
	{
		ds_list_p.AddColumn("FLR"+i,"STRING",255);
		ds_list_p.AddColumn("FMM"+i,"STRING",255);
	}

	for(var i=0; i<101; i++){
		ds_list_p.SetColumn(0,"FLR"+i,object("div_pop.ed_FLR"+i).text);
		ds_list_p.SetColumn(0,"FMM"+i,object("div_pop.ed_FMM"+i).text);
	}

	ds_list_p.SetColumn(0,"PIT",object("div_pop.Edit1").text);
	ds_list_p.SetColumn(0,"CESDBBAD",ds_master_p.GetColumn(0,"CESDBBAD"));
	ds_list_p.SetColumn(0,"CESDBBBD",ds_master_p.GetColumn(0,"CESDBBBD"));
	ds_list_p.SetColumn(0,"CESDBBCD",ds_master_p.GetColumn(0,"CESDBBCD"));
	ds_list_p.SetColumn(0,"CESDBBAS",ds_master_p.GetColumn(0,"CESDBBAS"));
	ds_list_p.SetColumn(0,"CESDBBBS",ds_master_p.GetColumn(0,"CESDBBBS"));
	ds_list_p.SetColumn(0,"CESDBBCS",ds_master_p.GetColumn(0,"CESDBBCS"));

	// UbiReport Call
	Dialog("PS11::PS1101003P.xml", "");
}
